import React from 'react'

const Nontification = () => {
    return (
        <div className="app">
            <Navbar bg="success" variant="dark" sticky="top">                    
                <Nav>
                    <Nav.Link href="/Nontification">Nontification</Nav.Link>
                </Nav>
            </Navbar>
            <div className="content">
                this is content
            </div>
        </div>
    )
}

export default Nontification;
